import React from "react";
import './App.css';
import AdminDashboard from "./components/Admin/AdminDashboard";  // Admin-related component
import UserDashboard from "./components/User/UserDashboard";    // User-related component
import ReportingDashboard from "./components/Reporting/ReportingDashboard";  // Reporting Dashboard (optional)

function App() {
  return (
    <div className="App">
      <h1>Welcome to the Admin Dashboard</h1>

      <div className="dashboard-section">
        <AdminDashboard />
      </div>

      <UserDashboard /> {/* Add the UserDashboard component here */}
      <ReportingDashboard /> {/* Add the ReportingDashboard component here */}
    </div>
  );
}

export default App;
